import React from "react";
import { NavLink } from "react-router-dom";
import { ReactComponent as SVGIcon } from '../img/logo.svg';

// Logo SVG
function Logo() {
    return (
        <NavLink to="/">
            <div className="SVGIcon">
                <SVGIcon style={{width:"200px", height:"100px"}} />
            </div>
        </NavLink>
    )
}

// User Link
function UserLinks() {
    return(
        <div>
            <NavLink to="/LogIn"> 로그인 </NavLink>
            <NavLink to="/"> 회원가입 </NavLink>
        </div>
    )
}

function Header() {
    return(
        <div>
            <Logo/>
            <UserLinks/>
        </div>
    )
}

export default Header;
